import SwiftUI

struct CardView: View {
    let firstName: String
    let lastName: String
    let studentID: String
    let studentImage: String?
    let verifyURL: String
    let barcodeData: String
    let universityIcon: String
    let bgColorCard: Color
    let bgColorSectionTop: Color
    let bgColorSectionBot: Color
    let fgColorTitle: Color
    
    var body: some View {
        VStack(alignment: .leading) {
            HStack {
                Spacer()
                if let data = Data(base64Encoded: universityIcon),
                   let image = UIImage(data: data) {
                    Image(
                        uiImage: image
                    )
                    .resizable()
                    .padding(.trailing, 12)
                    .padding(.top, 8)
                    .padding(.bottom, 4)
                    .scaledToFit()
                    .frame(height: 80)
                }
            }
            .background(bgColorSectionTop)
            
            
            
            HStack(spacing: 8) {
                Spacer()
                Text("STUDIERENDENAUSWEIS")
                    .bold()
                Spacer()
                Text("STUDENT CARD")
                Spacer()
                Text("CARTE D’ÉTUDIANT")
                Spacer()
            }
            .lineLimit(1)
            .minimumScaleFactor(0.6)
            .font(.caption2)
            .foregroundStyle(fgColorTitle)
            .padding(.horizontal, 4)
            VStack(spacing: 0) {
                HStack(alignment: .center, spacing: 12) {
                    if let studentImage = studentImage,
                       let data = Data(base64Encoded: studentImage),
                       let image = UIImage(data: data) {
                        Image(
                            uiImage: image
                        )
                        .resizable()
                        .scaledToFit()
                        .frame(height: 124).padding(.vertical, 8)
                    } else {
                        Image(
                            systemName: "person.crop.square"
                        )
                        .resizable()
                        .scaledToFit()
                        .aspectRatio(0.9, contentMode: .fit)
                    }
                    VStack(alignment: .center, spacing: 4) {
                        HStack {
                            VStack(alignment: .leading){
                                Text(firstName)
                                    .font(.subheadline)
                                
                                Text(lastName)
                                    .font(.subheadline)
                                Text(studentID)
                                    .font(.subheadline)
                            }
                            .foregroundStyle(bgColorSectionBot)
                            .colorInvert() 
                            .font(.caption2)
                            .bold()
                            Spacer()
                            if let qrCodeImage = verifyURL.generateQRCode(){
                                Image(uiImage: qrCodeImage)
                                    .interpolation(.none)
                                    .resizable()
                                    .frame(width: 84, height: 84)
                                    .scaledToFit()
                            }
                        }
                        if let barcodeImage = barcodeData.generateBarcode(){
                            Image(uiImage: barcodeImage)
                                .interpolation(.none)
                                .resizable()
                                .frame(
                                    height: 42
                                )
                                .scaledToFill()
                            
                        }
                        
                    }
                    .padding(.vertical, 4)
                }
                .padding(.leading, 16)
                
            }
            .padding(.trailing, 8)
            .background(bgColorSectionBot)
            .padding(.bottom, 32)
        }
        .modifier(
            CardViewModifier(
                backgroundColor: bgColorCard,
                cornerRadius: 12
            )
        )
        .aspectRatio(contentMode: .fit)
        
    }
    
}
    

